High quality 10/100Mbps Ethernet to Fiber Optic Media Converter 25KM SC (1 Pasang)

MEREK : netLINK
Model: HTB-3100AB

Features:
--An RJ45 ports and a single-fiber SC optical port,to achieve optical signal conversion between 10/100base TX twisted pair (Ethernet )and 100base FX (fiber optic);
--Core optical fiber can be completed in just one way signal transmission compared to dual fiber optic data transmission mode to improve the quantity doubled;
--Compliance with IEEE802.3 10Base-T and IEEE802.3u 100Base-TX, 100Base-FX standards;
--Has 10M/100M adaptive capacity;
--Ethernet interface can adaptively direct line / crossover cable connection;
--Support full / half duplex mode;
--Support IEEE802.3X duplex flow control and half-duplex backpressure flow control;
--1916 Byte support large data frame ( optional );
--Built- in lightning protection circuit , which can greatly reduce the damage caused by lightning induction;
--UTP up to 100 meters; longest 100 km single-mode fiber;
--Six LED indicators: Power, TX 100, TX Link / Act, FX 100, FX Link / Act, FDX / Col;easy to monitor the working status of the transceiver and determine the cause of the fault;
--Ambient temperature: 0-70 degree
--Humidity: 5% to 90%

Fiber Optic Parameters:
Fiber optic type: Single mode
Connector type: SC
Transmit Wave length: 1310/1550nm
Transmission distance: 25 Km
Min TX PWR: -9.0 dBm
Max TX PWR: -3 dBm
Sensitivity: -31.0 dBm
Link Budget: 22.0 dBm

Package Include: 
1x HTB-3100A 
1x HTB-3100B 
2x Adaptor
1x manual
